import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import TypeIt from 'typeit-react';

const Home = () => {
    return (
        <main>
            <div className="container">
                <Container maxWidth="lg">
                    <Box sx={{ bgcolor:'#fbbf24' , height:'100vh' }}></Box>
                </Container>
            </div>

            <Box  className="div-body mt-5" sx={ { fontWeight : 'bold', textAlign : 'center', pt : 4 , px : 15 }}>
                <TypeIt
                    options={{ 
                        strings : ["\"People say the longest sentence to ever be printed in literature belongs to Victor Hugo. The claim is that in Les Misérables there is a sentence which is 823 words long.\""],
                        speed : 60,
                        waitUntilVisible : true,
                        loop : false,
                     }}
                />
            </Box>

            <div className='container mt-5 d-flex justify-content-around text-white'>
                <Box class="div-box" href="/" sx={{ width : "33vh", height : 300 , bgcolor :"#f472b6", textAlign: "center", borderRadius : "5%", cursor : "pointer" }}>Browse a Book</Box>
                <Box class="div-box" href="/" sx={{ width : "33vh", height : 300,bgcolor :"#fbbf24",textAlign: "center", borderRadius : "5%", cursor : "pointer" }}>See Requested Books</Box>
                <Box class="div-box" href="/" sx={{ width : "33vh", height : 300, bgcolor :"#a3e635",textAlign: "center",borderRadius : "5%", cursor : "pointer" }}>Rate And Comment</Box>
            </div>
        </main>
    );
}

export default Home;
